import React from 'react';

import Card from '../card/card-component';

const CardArray = ({ friends }) => {
    const cardComponent = friends.map((friend, i) => {
        return (
            <Card id={i} key={i} name={friend[i].name} email={friend[i].email} />
        );
    });
    return(
        <div>{cardComponent}</div>
    );
};

export default CardArray;
